var app=angular.module("builtInApp",[]),adjArray=[],nounArray=[],userArray=[];app.controller("MainController",["$scope","$http",function(a,b){function c(){b.get("/getNouns").then(function(a){for(i=0;i<a.data.nouns.length;i++)nounArray.push(a.data.nouns[d(0,a.data.nouns.length-1)].Noun)}),b.get("/getAdj").then(function(a){for(i=0;i<a.data.adjectives.length;i++)adjArray.push(a.data.adjectives[d(0,a.data.adjectives.length-1)].Adjective)})}function d(a,b){return Math.floor(Math.random()*(1+b-a)+a)}a.getWords=function(){for(i=0;i<nounArray.length;i++)userArray.push(adjArray[i]+nounArray[i]);a.twitterPost=userArray},c()}]);